<script>
import { gsap, Bounce, Power2, Power1 } from "gsap";
export default {
  mounted() {
    this.blink();
  },
  methods: {
    blink() {
      const tl = gsap.timeline();

      tl.to(
        "#d-eyes",
        0.02,
        {
          scaleX: 1,
          scaleY: 0,
          transformOrigin: "bottom",
          repeat: 1,
          yoyo: true,
          ease: Power2.in,
          delay: 0,
        },
        1
      )
        .to(
          "#r-eyes",
          0.02,
          {
            scaleX: 1,
            scaleY: 0,
            transformOrigin: "bottom",
            repeat: 1,
            yoyo: true,
            ease: Power2.in,
            delay: 2,
          },
          1
        )

        .to(
          "#o-eyes",
          0.04,
          {
            scaleX: 1,
            scaleY: 0,
            transformOrigin: "bottom",
            repeat: 1,
            yoyo: true,
            ease: Power1.in,
            delay: 1,
          },
          1
        );
      return tl
        .repeat(-1)
        .duration(10)
        .play();
    },
  },
};
